module.exports={data:[{region:"Vale of Arryn",unid:"F3C2CE924605412888257E0000128173",seat:"The Eyrie (summer), Gates of the Moon (winter)",heir:"Harrold Hardyng",title:"King of Mountain and Vale (formerly), Warden of the East Lord of the Eyrie Defender of the Vale",overlord:"House Baratheon",words:"As High as Honor",name:"Arryn",description:"House Arryn of the Eyrie is one of the Great Houses of Westeros, and is the principal noble house in the Vale of Arryn. Their main seat is the Eyrie, which is considered impregnable, but they have many other holdings, including their winter castle at the Gates of the Moon, which was once their main seat. Both of these fortifications sit astride the Giant's Lance, the tallest mountain in the Vale, the Gates of the Moon at its foot, the Eyrie at its top.",coatOfArms:"Azure, upon a bezant argent a falcon volant of the field",currentLord:"Robert Arryn"},{region:"Stormlands",unid:"EF827514E00D43CA88257E000016915D",seat:"Storm's End King's Landing (House Baratheon of King's Landing) Dragonstone (House Baratheon of Dragonstone)",heir:"Princess Myrcella, Princess Shireen (disputed)",title:"Lord of Storm's End, Lord Paramount of the Stormlands",overlord:"Baratheons of King's Landing",words:"Ours Is The Fury",name:"Baratheon",description:"House Baratheon of Storm's End is one of the Great Houses of Westeros, and is the principal house in the stormlands, which they rule as Lords Paramount of the Stormlands. Their seat, Storm's End, is an ancient castle raised by the Storm Kings from the now-extinct House Durrandon. The Baratheon sigil is a crowned black stag on a field of gold. Members of the family tend to be tall and powerfully built, with black hair and blue eyes, as well as strong, square jawlines. They are known for their mercurial tempers, and their words are \"Ours is the Fury\".",coatOfArms:"A crowned stag sable",currentLord:"King Tommen I, King Stannis I (disputed)"},{region:"The Reach",unid:"09887656D18F175188257E00001561B0",seat:"Highgarden",heir:"Extinct",title:"King of the Reach",overlord:"none",words:"-Extinct-",name:"Gardener",description:"House Gardener of Highgarden is the extinct house of the old and famed Kings of the The Reach. Their seat was Highgarden, and the Gardener kings sat upon a living throne called the Oakenseat that grew from an oak that the mythical Garth Greenhand himself was reputedly said to have planted. The Kings of House Gardener wore crowns of vines and flowers when at peace, and crowns of bronze thorns (later iron) when they rode to war. Their blazon was a green hand over a white field.",coatOfArms:"Argent, a hand couped vert",currentLord:"Extinct"},{region:"Iron Islands",unid:"19A73BBCEAB0BC3188257E000016658F",seat:"Pyke",heir:"Theon Greyjoy",title:"King of Salt and Rock, Son of the Sea Wind, Lord Reaper of Pyke",overlord:"None, sovereign (disputed by House Baratheon of King's Landing and House Baratheon of Dragonstone)",words:"We Do Not Sow",name:"Greyjoy",description:'House Greyjoy of Pyke is one of the Great Houses of Westeros. It rules over the Iron Islands, a harsh and bleak collection of forbidding islands off the west coast of Westeros, from the Seastone Chair in the castle of Pyke on the island of the same name. The head of the family is traditionally known as the Lord Reaper of Pyke. Their sigil is a golden kraken on a black field, and their house motto is "We Do Not Sow." Members of the family tend to be attractive and well-built, with black hair.',coatOfArms:"Sable, a kraken Or",currentLord:"Sable, a kraken Or"},{region:"The Reach",unid:"D3B19F250F6AEE6988257E000015FAA0",seat:"The Hightower, Oldtown",heir:"Ser Baelor Hightower",title:"Voice of Oldtown Lord of the Port Lord of the Hightower Defender of the Citadel Beacon of the South King of the High TowerVoice of Oldtown Lord of the Port Lord of the Hightower Defender of the Citadel Beacon of the South King of the High Tower",overlord:"House Tyrell",words:"We Light the Way",name:"Hightower",description:'House Hightower of the Hightower is one of the most important and powerful vassals of House Tyrell (and before them of House Gardener). Their seat is the Hightower in the city of Oldtown within the Reach. The sigil of House Hightower is a stone white watchtower, with a fire on the top. Their words are "We Light the Way". They possess a Valyrian steel sword called Vigilance.',coatOfArms:"Cendr�e, a tower argent with a beacon on fire gules",currentLord:"Leyton Hightower"},{region:"Iron Islands, Riverlands",unid:"4DE933E58F65D21388257E00001641A6",seat:"Orkmont, Hoare Castle, Fairmarket, Harrenhal",heir:"Extinct",title:"King of the Iron Islands, King of the Isles and the Rivers",overlord:"none",words:"-Extinct-",name:"Hoare",description:"House Hoare of Orkmont is an extinct house of the Iron Islands. Known as the black line, or the black blood,  the Hoares became the Kings of the Iron Islands after the Andal settlers on the islands ended the rule of House Greyiron. While they originally came from Orkmont, they also built Hoare Castle on Great Wyk. The Hoares eventually moved to Fairmarket and Harrenhal in the riverlands where they ruled as Kings of the Isles and the Rivers.",coatOfArms:"Per saltire: two heavy silver chains crossing between (clockwise) a gold longship on black, a dark green pine on white, a cluster of red grapes on gold, and a black raven flying in a blue sky",currentLord:"Extinct"},{region:"Westerlands",unid:"EABEB1601EF7469F88257E000014F3A2",seat:"Casterly Rock",heir:"Tommen Baratheon",title:"King of the Rock (formerly),  Lord of Casterly Rock Shield of Lannisport Warden of the West",overlord:"House Baratheon",words:"Hear Me Roar!",name:"Lannister",description:'House Lannister of Casterly Rock is one of the Great Houses of Seven Kingdoms, and the principal house of the westerlands. Their seat is Casterly Rock, though another branch exists that is based in nearby Lannisport. Their sigil is a golden lion on a field of crimson. Their official motto is "Hear Me Roar!" However, their unofficial motto, equally well known, is "A Lannister always pays his debts." The Warden of the West is traditionally a Lannister.',coatOfArms:"Gules, a lion or",currentLord:"Queen Regent Cersei Lannister"},{region:"Dorne",unid:"A84FDD689561713588257E000016B577",seat:"Old Palace within Sunspear",heir:"Lord of the Sandship Lord of Sunspear Prince of Dorne",title:"Lord of the Sandship, Lord of Sunspear, Prince of Dorne",overlord:"House Baratheon of King's Landing",words:"Unbowed, Unbent, Unbroken",name:"Martell",description:"House Nymeros Martell of Sunspear is one of the Great Houses of Westeros and is the ruling house of Dorne. 'Nymeros' indicates \"of the line of Nymeria,\" but generally it is simply called House Martell. The seat of the Prince of Dorne is Sunspear in southeastern Dorne.",coatOfArms:"Tenny, a sun in splendour gules transfixed by a spear bendwise Or",currentLord:"Old Palace within Sunspear"},{region:"The North",unid:"896AA1D0286E4FE088257E0000123C29",seat:"Winterfell",heir:"Rickon Stark",title:"King in the North, Lord of Winterfell, Warden of the North, King of the Trident",overlord:"None (formerly House Baratheon)",words:"Winter is Coming",name:"Stark",description:"House Stark of Winterfell is one of the Great Houses of Westeros and the principal noble house of the North; many lesser houses are sworn to them. In days of old they ruled as Kings of Winter; since the Targaryen Conquest they have been Wardens of the North. Their seat, Winterfell, is an ancient castle renowned for its strength.",coatOfArms:"A running grey direwolf, on an ice-white field",currentLord:"Brandon Stark"},{region:"Crownlands, Valyria",unid:"0103FD4EB458904B88257E00000FE3E6",seat:"Red Keep, Dragonstone, Summerhall",heir:"",title:"King of the Andals, the Rhoynar and the First Men Lord of the Seven Kingdoms",overlord:"None",words:"Fire and Blood",name:"Targaryen",description:"House Targaryen is a noble family of Valyrian descent that escaped the Doom. They lived for centuries on the island of Dragonstone until Aegon the Conqueror and his sisters rode their dragons in the conquest of the Seven Kingdoms.\r\nHouse Targaryen ruled as the Kings on the Iron Throne and the Great House of the crownlands for nearly 300 years, until their ouster in Robert's Rebellion. Their seats were the Red Keep in the capital city of King's Landing, the island castle of Dragonstone, and the summer residence of Summerhall.",coatOfArms:"Sable, a dragon thrice-headed",currentLord:"Queen Daenerys Targaryen"},{region:"The Reach",unid:"57FFA05DC92F9CCF88257E000015CF43",seat:"Highgarden",heir:"Willas Tyrell",title:"Lord of Highgarden Defender of the Marches High Marshal of the Reach Warden of the South Lord Paramount of the Mander High Steward of Higharden (pre-Conquest)",overlord:"House Baratheon",words:"Growing Strong",name:"Tyrell",description:"House Tyrell of Highgarden is one of the Great Houses of the Seven Kingdoms, being liege lords of the Reach. A large, wealthy house, its wealth is only surpassed among the Great Houses by House Lannister, and the Tyrells can field the greatest armies. Additionally, if they call the fleets of their bannermen the Redwynes, the lords of the Shield Islands, and the coastal lords, they can command a navy that equals if not surpasses the royal fleet.",coatOfArms:"Vert, a rose Or",currentLord:"Mace Tyrell"}]};
